import React from 'react'
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Mentor from './component/mentor/Mentor';

function App() {
  return (
    <div>
      <BrowserRouter>
      <Routes>
      <Route path="/" element={<Mentor/>} />
      </Routes>
      </BrowserRouter>

    </div>
  )
}

export default App
